import React, {Component} from 'react';

import {Container, Form, FormGroup, Label, Input, } from 'reactstrap';
import { BrowserRouter, Link } from "react-router-dom";
import 'aos/dist/aos.css';

class ContactSec extends Component {


    render(){
       
        return(
            <React.Fragment>
            <div className="contact_sec">
                <Container className="contact_wrapp">
                        <BrowserRouter>
                            <Link className="logo_image d-block m-auto" to="#">
                                <img src="images/logo.png" alt="Logo"/>
                                <span>9586331526</span>   
                            </Link>
                        </BrowserRouter>
                    <Form className="login_form">
                        <FormGroup>
                            <Label>Name</Label>
                            <Input class="form-control" type="text" placeholder="enter sin here" />
                        </FormGroup>
                        <FormGroup>
                            <Label>Email</Label>
                            <Input  class="form-control" type="email" name="mail" placeholder="full name of candiate to be displayed " />
                        </FormGroup>
                        <FormGroup>
                            <Label>Phone</Label>
                            <Input  class="form-control" type="number" name="number" placeholder="enter password here" />
                        </FormGroup>
                        <button className="submit_btn">Submit</button>
                    
                    </Form>

                </Container>
            </div>
        </React.Fragment>
            
        );

        
    }

}
export default  ContactSec;
